import { Component } from "react";

class StorePicker extends Component {
  render() {
    return (
      <Fragment>
        <p>Fish!</p>
        <form className="store-selector">
          <h2>Please enter a store</h2>
        </form>
      </Fragment>
    );
  }
}

export default StorePicker;
